import { Link } from 'react-router-dom'

export default function Navbar() {
    return (
        <div>
            <ul id="Nav">
                <il class = "Nav"><Link to = "/" class = "NavText">Home page</Link> </il>
                <il class = "Nav"><Link to = "/Second" class = "NavText"> See your Debits!</Link></il>
                <il class = "Nav"><Link to = "/Third" class = "NavText"> See your Credits</Link></il>
            </ul>
        </div>
    )
}
